function ToDo({ token }) {
  return (
    <>
      <h1>ToDo</h1>
      <p>Here is a list of things to do:</p>
      <ul>
        <li>Learn React</li>
        <li>Learn React Router</li>
        <li>Learn Styled Components</li>
      </ul>
    </>
  );
}

export default ToDo;
